  //write the code for quickSort
  public static void quickSort(int[] arr){
    int n = arr.length;
    quickSortHelper(arr, 0, n -1);
  }

  public static void quickSortHelper(int[] arr, int left, int right){
    if(left < right){
      int pivot = partition(arr, left, right);
      
      quickSortHelper(arr, left, pivot -1);
      quickSortHelper(arr, pivot + 1, right);
    }
  }

  public static int partition(int[] arr, int left, int right){
    int pivot = left;
    int l = left + 1;
    int r = right;

    while(l <= r){
        while(l <= r && arr[l] <= arr[pivot]){
            l++;
        }
        while(l <= r && arr[r] >= arr[pivot]){
            r--;
        }

        if(l <= r){
            int temp = arr[l];
            arr[l] = arr[r];
            arr[r] = temp;
        }
        else{
            int temp = arr[pivot];
            arr[pivot] = arr[r];
            arr[r] = temp;
        }
    }
    return r;
  }

